import './App.scss';

class Users extends Component {
  render () {
    const individual = userData.u

  return (
      <div>

        {

          userData.map(individual => {
            return (


            <table class = "table">
               <tbody>
                  <tr>
                     <td>{individual.name}</td>
                     <td>{individual.meetingTime}</td>

                  </tr>

               </tbody>
            </table>


           );

          })
        }
    </div>
   ) 
  }
}

export default Users;
